import React from 'react';
import { Line } from "react-chartjs-2";
import "./Chart1.css"
import * as FaIcons from 'react-icons/fa'



import {
  LineChart_ProductionTime, 
} from "variables/charts";


const Chart1 = ({LineChart_Chart1_Example1}) => {
if(LineChart_Chart1_Example1=="HourlyData"){
    var title = "Hourly";
}
if(LineChart_Chart1_Example1=="DailyData"){
    var title = "Daily";
}
if(LineChart_Chart1_Example1=="MonthlyData"){
    var title = "Monthly";
}

        return (
    <>

            <div className='Chart1'>

                <div className='Chart1-header'>
                  <FaIcons.FaChartArea className='Chart1-icon' size={20} color={'white'}/>
                  <h3 className='Chart1-title'>{title} Production Time Report</h3>
                </div>

              <div className="Chart1-body">
                  <div className="Chart1-chart">
                    <Line
                      data={LineChart_[LineChart_Chart1_Example1]}
                      options={LineChart_Chart1.options}
                    />
                  </div>

              </div>
            </div>

     </>
        )

};

export default Chart1;
